    const [name, setname] = useState("initialState");
    const [error, seterror] = useState(false)
    const [success, setsuccess] = useState(false)

    const {user,token} = isAutheticated();

    const goBackHome=()=>{
        return(
            <div className="mt-5">
            <Link to="/admin/dashboard" className="btn btn-sm btn-success mb-3">Admin Home</Link>
            </div>

        )
    }

    const myCategoryForm=()=>{
        return(
            <form>
            <div className="form-group">
            <p className="lead">Enter the Category</p>
            <input type="text" className="form-control my-3"
            autofocus required placeholder="For Ex.Summer"/>
            <button className="btn btn-outline-danger">Create Category</button>
            </div>
            </form>
        )
    }





    return (



        <Base title="Create a category here" description="Add a new category for exhausts" className="container bg-info p-4" >
        <div className="row bg-white-rounded">
        <div className="col-md-8 offset-md-2">
        {myCategoryForm()}
        {goBackHome()}
        </div>
        </div>
        </Base>
    )
}
export default AddCategory
